import React from 'react'

class Index extends React.Component {
    render() {
        return (
        <div>
            <h1>QuizMaster</h1>
            <Link to="/jugar"><button>Jugar</button></Link>
            <Link to="/crear"><button>Crear juego</button></Link>
        </div>
        )
    }
}

export default Index
